'use client'

import React, { useState, useEffect } from "react";
import axios from "axios";
import { Link } from "react-router-dom";
import { Table } from "flowbite-react";

export const Dashboard = () => {
  const [authenticated, setAuthenticated] = useState(false);

  useEffect(() => {
    const storedToken = localStorage.getItem("token");
    if (storedToken) {
      setAuthenticated(true);
    }
  }, []);

  return (
    <div className="rounded-lg p-8">
      <h2 className="text-2xl font-bold mb-4">Trending repositories</h2>
      <Table hoverable>
        <Table.Body className="divide-y">
          <Table.Row className="bg-white dark:border-gray-700 dark:bg-gray-800">
            <Table.Cell>
              <h3 className="text-lg font-bold">THUDM/ChatGLM3</h3>
              <p className="text-sm text-gray-500">ChatGLM3 series: Open Bilingual Chat LLMs | 开源双语对话语言模型</p>
              <div className="flex items-center space-x-2">
                <span className="text-sm text-gray-600">Python</span>
                <span className="text-sm text-gray-600">2.3k stars</span>
              </div>
            </Table.Cell>
          </Table.Row>
        </Table.Body>
      </Table>
      <div className="mt-4">
        <Link to="/more" className="text-blue-500 hover:underline">See more</Link>
      </div>
    </div>
  );
};
